import React from 'react';

const Day = (props) => (
	<div>
		<div>Temperatura: {props.temperature}</div>
		<div>Oblaci: {props.weatherDescription}</div>
		<div>
			<img src={props.iconUrl} alt={props.icon} />
		</div>
	</div>
);

export default Day;
